const API = 'Fchhxqpcq2zoXHjbkrSTBgaRUXWIl3tk';

fetch(`http://api.giphy.com/v1/gifs/random?api_key=${ API }`)
.then(response => response.json())
.then(({ data }) => {
    console.log(data.images.original);
})
.catch((error) => {
    console.error(error);
})
